import React, { useState } from 'react';
import {
  Box,
  Button,
  TextField,
  Typography,
  IconButton,
  Snackbar,
  Alert,
  Slide
} from '@mui/material';
import { motion } from 'framer-motion';
import CancelIcon from '@mui/icons-material/Cancel';

export default function AsesoriaForm() {
  const [formData, setFormData] = useState({ nombre: '', correo: '', mensaje: '' });
  const [errors, setErrors] = useState({});
  const [openSnackbar, setOpenSnackbar] = useState(false);

  const validate = () => {
    const newErrors = {};
    if (!formData.nombre.trim()) newErrors.nombre = 'Nombre requerido';
    if (!formData.correo.includes('@')) newErrors.correo = 'Correo inválido';
    if (!formData.mensaje.trim()) newErrors.mensaje = 'Mensaje requerido';
    return newErrors;
  };

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const newErrors = validate();
    if (Object.keys(newErrors).length > 0) {
      setErrors(newErrors);
    } else {
      setErrors({});
      setOpenSnackbar(true);
      // Aquí va la lógica de envío
      console.log('Enviado:', formData);
    }
  };

  const handleCancel = () => {
    setFormData({ nombre: '', correo: '', mensaje: '' });
    setErrors({});
  };

  return (
    <Box
      sx={{
        minHeight: '100vh',
        background: 'linear-gradient(to right, #e0f7fa, #ffffff)',
        display: 'flex',
        flexDirection: 'column',
        justifyContent: 'center',
        alignItems: 'center',
        px: 3,
        py: 5,
      }}
    >
      <motion.div
        initial={{ opacity: 0, y: -30 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.6 }}
        style={{ width: '100%', maxWidth: 500 }}
      >
        <Box
          component="form"
          onSubmit={handleSubmit}
          sx={{
            background: '#fff',
            borderRadius: 3,
            boxShadow: 5,
            p: 4,
          }}
        >
          <Box display="flex" justifyContent="space-between" alignItems="center">
            <Typography variant="h5" fontWeight={600} color="primary.main">
              Solicita una Asesoría Personalizada
            </Typography>
            <IconButton onClick={handleCancel} color="error">
              <CancelIcon />
            </IconButton>
          </Box>

          <TextField
            label="Nombre completo"
            variant="outlined"
            name="nombre"
            fullWidth
            margin="normal"
            value={formData.nombre}
            onChange={handleChange}
            error={Boolean(errors.nombre)}
            helperText={errors.nombre}
            InputLabelProps={{ shrink: !!formData.nombre }}
          />

          <TextField
            label="Correo electrónico"
            variant="outlined"
            name="correo"
            fullWidth
            margin="normal"
            value={formData.correo}
            onChange={handleChange}
            error={Boolean(errors.correo)}
            helperText={errors.correo}
            InputLabelProps={{ shrink: !!formData.correo }}
          />

          <TextField
            label="Cuéntanos en qué necesitas ayuda"
            variant="outlined"
            name="mensaje"
            multiline
            rows={4}
            fullWidth
            margin="normal"
            value={formData.mensaje}
            onChange={handleChange}
            error={Boolean(errors.mensaje)}
            helperText={errors.mensaje}
            InputLabelProps={{ shrink: !!formData.mensaje }}
          />

          <Box mt={3} display="flex" justifyContent="space-between">
            <Button variant="outlined" color="secondary" onClick={handleCancel}>
              Cancelar
            </Button>
            <Button variant="contained" color="primary" type="submit">
              Enviar solicitud
            </Button>
          </Box>
        </Box>
      </motion.div>

      <Snackbar
        open={openSnackbar}
        autoHideDuration={3000}
        onClose={() => setOpenSnackbar(false)}
        TransitionComponent={Slide}
        anchorOrigin={{ vertical: 'bottom', horizontal: 'center' }}
      >
        <Alert severity="success" variant="filled" sx={{ width: '100%' }}>
          Solicitud enviada correctamente
        </Alert>
      </Snackbar>
    </Box>
  );
}
